@app.route('/classify', methods=['POST'])
def classification():
    file = request.files['fileToUpload']
    if file:
        filename = secure_filename(file.filename)
        file.save(os.path.join(app.config['UPLOAD_FOLDER'], filename))
    
    # image = request.files['fileToUpload'].read()
    # content  =  fileToUpload.read()
    content = cv.imread(UPLOAD_FOLDER+filename, 0)
    content = content.astype('float32')
    content = content / 255.0
    content = content.reshape(1, 28, 28, 1)

    predictions = base_model.predict(content)
    output=np.argmax(predictions[0]).tolist()
    return jsonify({"output": output})

